import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="logo-container">
        <div className="mc-movers-logo">
          <img 
            src="/mc-movers-logo.png" 
            alt="MC Movers Logo" 
            className="footer-logo"
          />
        </div>
      </div>
    </footer>
  );
};

export default Footer;
